function getLiveData() {
	for (let i = 0; i < live.length; i++) {
		for (let j = 0; j < live[i].difficulties.length; j++) {
			if (live[i].difficulties[j].difficulty == 3) {
				let sif = new sifConverter()
				sif.analyze('https://card.niconi.co.ni/live/' + live[i].difficulties[j].asset).then(function () {
					console.log(JSON.stringify(live[i]));
					//console.log("analyzed: \n" + sif.malives[0])
					console.log("original: \n" + sif.lives[0])
					saveAs(
						new Blob(
							[JSON.stringify(sif.lives[0])]
							, { type: "text/plain;charset=utf-8" }
						)
						, "live" + live[i].difficulties[j].id + "_origin.txt"
					);
					saveAs(
						new Blob(
							[JSON.stringify(sif.malives[0])]
							, { type: "text/plain;charset=utf-8" }
						)
						, "live" + live[i].difficulties[j].id + "_analyzed.txt"
					);
				},
					function () {
						console.log("fail");
					})
			}
		}
	}
}


module.exports = {
	sifConverter: sifConverter
}